import jsPDF from 'jspdf';

const mulishFont = function () {
    const font = '';
    const fontBold = "";
    const callAddFont = function () {
        this.addFileToVFS('mulish.ttf', font);
        this.addFont('mulish.ttf', 'mulish', 'regular');
        this.addFileToVFS('mulish_bold.ttf', fontBold);
        this.addFont('mulish_bold.ttf', 'mulish', 'bold');
    };
    jsPDF.API.events.push(['addFonts', callAddFont]);
};

export default mulishFont;